import logo from './logo.svg';
import './index.css';
import Home from './Pages/Home';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';


function App() {
  return (
    <div className="App">
    <h1>My name is Ade</h1>
     <Switch>
       <Route path="/" component={Home} exact />
     </Switch>
    </div>
  );
}

export default App;
